import React from "react";
import { Link } from "react-router-dom";
import "./StickyBlockBox.css";

function StickyBlockBox(props) {
  const { list } = props;
  return (
    <div className="stickyblockbox-wrap">
      {list.map((item, index) => (
        <div className="item-wrap" key={index + item}>
          <Link to={item.href} className="item-link">
            <div className="item">
              {item.type === "H1" && <div className="font-h1">{item.name}</div>}
              {item.type === "H2" && <div className="font-h2">{item.name}</div>}
            </div>
          </Link>
        </div>
      ))}
    </div>
  );
}
export default StickyBlockBox;
